import React, {Component} from 'react';
import MapContainer from './components/map';
import './App.css';

function Button(props) {
  return <button> {props.label} </button>
}

function App() {
  return (
    <div className="App">


      <header className="App-header">
      <h2>
        <Button label = "Dog"/>
        <Button label = "Cat"/>
        <Button label = "Moose"/>
        <Button label = "Beaver"/>
      </h2>
      </header>
      <MapContainer />
    </div>
  );
}

export default App;
